import React from 'react';
import './App.css';

//import components
import Nav from './Nav';
import Search from './Search';
import Gallery from './Gallery';
import NoResults from './NoResults';

function App() {
  return (
    <div className="container">
      <Nav />
      <Search />
      <Gallery /> 
        <NoResults />

    </div>

  );
}

export default App;
